import React from 'react';
import { Toggleinput, ToggleControl } from './toggle.styles';

const Toggle = ({ checked, onChange }) => (
  <ToggleControl>
    <Toggleinput
      className="dmcheck"
      type="checkbox"
      checked={checked}
      onChange={onChange}
      id="dmcheck"
    />
    <label htmlFor="dmcheck" />
  </ToggleControl>
);

export default Toggle;
